import { makeStyles } from "@material-ui/core";

export const useStyles = makeStyles({
    root: {
        borderBottom: '1px solid #a4b0be',
        color: 'white'
    },
    title: {
        flexGrow: 1,
        textTransform: 'uppercase',
    }
})
